import { useState } from 'react'
import * as styleSass from '../../../styles/buttons.module.scss'

function Button(props) {
  const [rounded, setRounded] = useState(false)
  const conStyle = {
    width: props.width,
    height: props.height,
  }
  return (
    <button style={conStyle} className={styleSass.button}>
      {props.children}
    </button>
  )
}
export default Button
